contracts/CriminalCaseFiling.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CriminalCaseFiling {
    uint public caseCount = 0;

    struct CriminalCase {
        uint id;
        string dateTimeOfIncident;
        string location;
        string victimName;
        string suspectName;
        string description;
        string charges;
        string arrestInformation;
        string evidence;
        bool deleted;
    }

    mapping(uint => CriminalCase) public cases;

    event CaseFiled(
        uint id,
        string dateTimeOfIncident,
        string location,
        string victimName,
        string suspectName,
        string description,
        string charges,
        string arrestInformation,
        string evidence
    );

    event CaseUpdated(
        uint id,
        string dateTimeOfIncident,
        string location,
        string victimName,
        string suspectName,
        string description,
        string charges,
        string arrestInformation,
        string evidence
    );

    event CaseDeleted(uint id);

    function getCriminalCaseCount() public view returns (uint) {
        return caseCount;
    }

    function createCase(
        string memory _dateTimeOfIncident,
        string memory _location,
        string memory _victimName,
        string memory _suspectName,
        string memory _description,
        string memory _charges,
        string memory _arrestInformation,
        string memory _evidence
    ) public {
        caseCount++;
        cases[caseCount] = CriminalCase(
            caseCount,
            _dateTimeOfIncident,
            _location,
            _victimName,
            _suspectName,
            _description,
            _charges,
            _arrestInformation,
            _evidence,
            false
        );
        emit CaseFiled(
            caseCount,
            _dateTimeOfIncident,
            _location,
            _victimName,
            _suspectName,
            _description,
            _charges,
            _arrestInformation,
            _evidence
        );
    }

    function updateCase(
        uint _id,
        string memory _dateTimeOfIncident,
        string memory _location,
        string memory _victimName,
        string memory _suspectName,
        string memory _description,
        string memory _charges,
        string memory _arrestInformation,
        string memory _evidence
    ) public {
        CriminalCase storage _case = cases[_id];
        require(!_case.deleted, "Case has been deleted");
        _case.dateTimeOfIncident = _dateTimeOfIncident;
        _case.location = _location;
        _case.victimName = _victimName;
        _case.suspectName = _suspectName;
        _case.description = _description;
        _case.charges = _charges;
        _case.arrestInformation = _arrestInformation;
        _case.evidence = _evidence;
        emit CaseUpdated(
            _id,
            _dateTimeOfIncident,
            _location,
            _victimName,
            _suspectName,
            _description,
            _charges,
            _arrestInformation,
            _evidence
        );
    }

    function deleteCase(uint _id) public {
        CriminalCase storage _case = cases[_id];
        require(!_case.deleted, "Case has already been deleted");
        _case.deleted = true;
        emit CaseDeleted(_id);
    }
}

